	 function reportErro(){
	 	var form = document.createElement("form");
		form.setAttribute("method", "post");
		form.setAttribute("action", "ilustradoPro");
		form.style.visibility = "hidden";
		
		var i = document.createElement("input"); //input element, text
		i.setAttribute('type',"text");
		i.setAttribute("id","caixa1");
		i.setAttribute("name","caixa1");
		i.setAttribute("value",document.getElementById("caixa1").value);
		
		var j = document.createElement("input"); //input element, text
		j.setAttribute('type',"text");
		j.setAttribute("id","erro");
		j.setAttribute("name","erro");
		j.setAttribute("value","Erro");
		
		var s = document.createElement("input"); //input element, Submit button
		s.setAttribute('type',"submit");
		s.setAttribute('value',"Submit");
		
		form.appendChild(i);
		form.appendChild(j);
		form.appendChild(s);
		document.body.appendChild(form);
		form.submit();
	 }
	    
		// Evento da troca do símbolo
		
		var id_edit = -1; // variável que será usada pra armazenar id que irá alterar o símbolo
		var nome = '';
		var nome_original = '';
		var novo_nome = '';
		var indice = 0;
		var permissao = false;
		
		function mudar_simbolo(){
			if (permissao == true){
				if (id_edit != -1){
					document.getElementById("img_"+id_edit).src = "https://raw.github.com/juniorcaemj/ca2ju-pictogramas/master/pictogramas/"+retira_acentos(novo_nome);
					indice = 0;
					document.getElementById('b_salvar').style.visibility = 'visible'; //mostrar o botao de salvar
				}
				document.getElementById("pictograma").innerHTML = '';
				document.getElementById("pesquisa").value = 'Digite o nome do símbolo';
				document.getElementById("alterar_simbolo").style.display = 'none';
				permissao = false;
			}
		}
		
		function alterar_simbolo(id){
			document.getElementById("alterar_simbolo").style.display = 'block';
			id_edit = id;
		}
		
		function remover_simbolo(){
			$('#'+id_edit).remove();
			id_edit = -1;
			cancelar_alteracao();
			document.getElementById('b_salvar').style.visibility = 'visible'; //mostrar o botao de salvar
		}
		
		function cancelar_alteracao(){
			document.getElementById("pictograma").innerHTML = '';
			document.getElementById("pesquisa").value = 'Digite o nome do símbolo';
			indice = 0;
			document.getElementById("alterar_simbolo").style.display = 'none';
			permissao = false;
		}
		
		function mostrar_simb(p){
			p = String(p);
			p = p.toLowerCase();
			if (palavras[p] != null){
				permissao = true;
				document.getElementById('pictograma').innerHTML = "<img id=\"simb_atual\" src=\"https://raw.github.com/juniorcaemj/ca2ju-pictogramas/master/pictogramas/"+retira_acentos(palavras[p])+"\" width=\"100\" height=\"100\" align=\"middle\"/>";
				nome = palavras[p];
				nome_original = nome;
				novo_nome = nome;
			}else{
				permissao = false;
				document.getElementById('pictograma').innerHTML = "<p align=\'center\'>Pictograma não existe</p>";
			}
		}
		
		function trocar_simbolo(p){
			p = p.toLowerCase();
			if (p != ''){
				indice = indice+1;
				if (palavras[p+"_"+indice] != null){
					novo_nome = nome.substr(0,(nome.length)-4)+"_"+indice+".png";
					document.getElementById("simb_atual").src = "https://raw.github.com/juniorcaemj/ca2ju-pictogramas/master/pictogramas/"+novo_nome;
				}else{
					indice = 0;
					document.getElementById("simb_atual").src = "https://raw.github.com/juniorcaemj/ca2ju-pictogramas/master/pictogramas/"+nome_original.substr(0,(nome_original.length)-4)+".png";
					novo_nome = nome_original.substr(0,(nome_original.length)-4)+".png";
				}
			}
		}
		
		//Ação ao pressionar Enter no campo de alteração de símbolo
			document.getElementById('pesquisa').onkeypress = function(e){
				if (!e) e = window.event;
				var keyCode = e.keyCode || e.which;
				if (keyCode == '13'){
				  // Enter pressed
				  mostrar_simb(document.getElementById("pesquisa").value);
				}
			}
		
		///////////////////////////////////////////
	 
	 	function retira_acentos(palavra) {
			com_acento = "áàãâäéèêëíìîïóòõôöúùûüçÁÀÃÂÄÉÈÊËÍÌÎÏÓÒÕÖÔÚÙÛÜÇ";
			sem_acento = "aaaaaeeeeiiiiooooouuuucAAAAAEEEEIIIIOOOOOUUUUC";
			nova = "";
			
			for(i=0;i<palavra.length;i++) {
				if (palavra.substr(i,4) == '.png'){
					nova += '.png';
					break;
				}else if (com_acento.search(palavra.substr(i,1))>=0)
					nova += sem_acento.substr(com_acento.search(palavra.substr(i,1)),1);
				else 
					nova += palavra.substr(i,1);
			}
			return nova;
		}
		
